eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   BACKGROUND_CONTEXT: () => (/* binding */ BACKGROUND_CONTEXT)\n/* harmony export */ });\nconst BACKGROUND_CONTEXT = `# Background Context for LLM\n\nThis document contains structured information about the site owner to help provide better, more personalized responses. Each section includes specific instructions for how the LLM should utilize the information.\n\n## Bio\n[LLM Usage: This bio information should shape how you present Andrew to potential clients. When responding:\n1. Always frame information in terms of value to the client\n2. Emphasize current focus on early-stage startups and AI products\n3. Use specific examples from work history to support claims\n4. Highlight the unique combination of design, technical, and architectural thinking\n5. When discussing background:\n   - Focus on how diverse experience benefits clients\n   - Emphasize ability to bridge design and implementation\n   - Highlight successful track record with both startups and established companies\n   - Show how architectural background enables systematic thinking\n6. Key themes to weave into responses:\n   - Proven ability to take products from concept to launch\n   - Deep understanding of both user needs and technical constraints\n   - Track record of successful remote collaboration\n   - Experience with cutting-edge AI products\n   - Ability to work effectively with technical teams\n]\n\n### Personal Background\n- **Origin:** Born in West Palm Beach, Florida.  \n- **Residences:** Lived up and down the East Coast, including Cambridge, MA, the Berkshires, and Providence, RI. Moved to California in 2014 and currently resides in San Francisco.  \n- **Education:** Attended undergrad and graduate school, emphasizing critical thinking, problem-solving, and understanding constraints through design.\n\n### Key Interests and Passions\n- **Creative Pursuits:** Passionate about sculpture and creating artwork. Aspires to dedicate more time to art and less to paid design work.  \n- **Animals:** Loves cats, birds, and animals in general.  \n- **Making a Difference:** Strives to create work that impacts real people and addresses real problems, moving away from business-driven projects.  \n\n### Professional Focus Areas\n- **Design Approach:** A well-rounded generalist, working across product strategy, UX/UI design, and even coding and implementation.  \n- **Specializations:** Excels in taking products from 0 to 1 or MVP, working closely with engineers, and navigating technical constraints.  \n- **Domains:** Recently focused on AI-driven projects and rediscovered a passion for mission-driven work. Enjoys mentoring young designers, especially those transitioning from unrelated fields into tech or product design.  \n\n### Values and Principles\n- **Motivations:** Attracted to projects with interesting challenges, cool people, and opportunities to work on AI or mission-driven problems.  \n- **Values:** Emphasizes the human experience, aiming to create digital products that make life better instead of worse.  \n- **Design Philosophy:** Focuses on improving lives through thoughtful, empathetic design.  \n\n### Current Goals and Aspirations\n- **Professional Goals:** Wants to take on more meaningful work, prioritize personal projects, and continue enjoying the freelance lifestyle.  \n- **Personal Goals:** Aims to save for property and find a more sustainable, affordable place to live with a partner and their cats (and future animals).  \n- **New Pursuits:** Seeks to deepen a sculpture and art practice, which is the primary area of new exploration and learning.  \n\n---\n\n\n## Work History\n[LLM Usage: This work history demonstrates Andrew's journey and expertise. When discussing his experience:\n1. Prioritize recent and relevant roles (especially Meta, Watch Duty, and current freelance work)\n2. Focus on achievements that demonstrate value to potential clients\n3. Highlight the progression from architecture to product design to show versatility\n4. Emphasize experience with both startups and large tech companies\n5. When answering questions about work history:\n   - Start with current role and most relevant experience\n   - Summarize key achievements that match the user's likely needs\n   - Connect past experiences to current value proposition\n   - Avoid simply listing jobs chronologically\n   - Frame responses in terms of how this experience benefits potential clients\n6. Key narrative points to emphasize:\n   - Proven track record with both early-stage startups and major tech companies\n   - Unique background combining architecture, design, and development\n   - Demonstrated ability to take products from 0 to 1\n   - Experience with AI products and cutting-edge technology\n   - History of successful remote collaboration\n]\n\n### Freelance Product Designer\n**Liebchen Worldwide**  \n*Feb 2023 – Present*  \nSan Francisco, California, United States (Remote)  \nHelping early-stage startups conceive, design, and build 0-to-1 products, with a focus on generative AI, business, and medical domains. Notable achievements include:\n\n- 🔥 Delivered the initial core experiences for Watch Duty's community wildfire tracking app. Now supporting its 3rd wildfire season, the app has provided residents and firefighters real-time information about fires affecting their lives and homes.\n- 🤖 Designed and developed Miri AI's MVP coaching app to help wellness coaches scale their methodology and personal approach to growing client bases.\n\n### Meta\n**Senior Product Designer**  \n*Jan 2021 – Nov 2022*  \nSan Francisco Bay Area  \nLed design for the Meta Quest mobile app, collaborating with an XFN product team of 10+ engineers and designers from Reality Labs to create \"a bridge to the metaverse.\" The app serves millions of users monthly and generates a significant portion of Quest's total revenue.\n\n**Senior Product Designer**  \n*Jan 2020 – Jan 2021*  \nMenlo Park, California  \nDesigned social experiences for VR, including integrating FB Messenger into Oculus Quest and inventing ways to join friends in the metaverse instantly.\n\n**Product Designer**  \n*Sep 2016 – Jan 2020*  \nMenlo Park, California  \nDesigned and built HR and data products for tens of thousands of Facebook employees worldwide.\n\n### Persista\n**Founding Product Designer**  \n*Feb 2016 – Jun 2016*  \nSan Francisco Bay Area  \nCollaborated with the founder and engineering team to design and build a zero-to-one federated search product for email, chats, and documents.\n\n### OpenGov Inc.\n**Lead Designer**  \n*Jan 2014 – Nov 2015*  \nDesigned and developed products that revolutionize how governments understand, explore, and plan their public finances.\n\n### Financial Diligence Networks\n**Lead Designer**  \n*Nov 2012 – Dec 2013*  \nBoston, MA  \nCreated user experiences for a social networking and information exchange platform for the finance industry. Handled front-end design and coding in a fast-paced, agile startup environment.\n\n### GroupVisual.io\n**Senior Visual Designer**  \n*May 2010 – Nov 2012*  \nGreater Boston Area  \nDefined user experiences and visual designs for business information visualizations, B2C/B2B interfaces, and marketing websites, collaborating with cross-functional teams and clients.\n\n### Deelux\n**Co-owner & Creative Director**  \n*Sep 2009 – Feb 2012*  \nProvidence, Rhode Island Area  \nProvided thoughtful graphic and web design for clients, including artists, non-profits, and small businesses.\n\n### Rhode Island School of Design\n**Teaching Assistant**  \n*Sep 2006 – Jun 2009*  \nProvidence, Rhode Island Area  \nSupported first-year architecture students through crucial design exercises, alongside the lead studio critic.\n\n### Friedrich St. Florian, Architect\n**Architectural Intern**  \n*Jan 2009 – Feb 2009*  \nProvidence, Rhode Island Area  \nCollaborated with a diverse team to produce designs and drawings for an international architectural competition entry.\n\n### Capital Repertory Theatre\n**Properties Master**  \n*Sep 2005 – Aug 2006*  \nAlbany, New York Area  \nCreated theatrical properties for a small, busy LORT theatre, balancing artistic and budgetary constraints. Managed a small production shop and oversaw interns.\n\n### Barrington Stage Company\n**Assistant Technical Director**  \n*May 2005 – Sep 2005*  \nPittsfield, Massachusetts Area  \nProduced technical drawings and designs for a professional summer-stock season of musicals and plays.\n\n\n## Education\n\n### Rhode Island School of Design\n- **Degree:** Master of Architecture (MArch)  \n- **Field of Study:** Architecture  \n\n### University of North Carolina at Greensboro\n- **Degree:** Bachelor of Fine Arts (BFA)  \n- **Field of Study:** Technical Theatre/Theatre Design and Technology \n\n\n## Volunteering\n\n### Watch Duty\n- **Role:** Product Designer  \n- **Focus:** Disaster and Humanitarian Relief  \n- **Description:** Collaborated with a small team to design and build a fire tracking app for the 2021 fire season in Northern California. Watch Duty notified residents in Sonoma, Napa, Mendocino, and Lake Counties about nearby fires and tracked fires based on reports from Public Information Officers.  \n- [Learn more about Watch Duty from The Guardian](https://www.theguardian.com/us-news/2022/feb/02/watch-duty-app-warning-wildfires-california-silicon-valley)\n\n### Andreessen Horowitz (a16z)\n- **Role:** Design Mentor  \n- **Duration:** Jan 2016 – Dec 2019 (4 years)  \n- **Focus:** Education  \n- **Description:** Participated in a16z's Generation Design (Gen.D), a mentorship initiative connecting college design students with top industry professionals. Guided several new graduates through the transition into their first design roles, providing support and insights to help them succeed in the competitive tech landscape.\n\n### Meta\n- **Role:** Intern Manager  \n- **Focus:** Education  \n- **Description:** Volunteered as an intern manager at Meta, guiding student designers through their summer internships. Responsibilities included designing a comprehensive project tailored to their skills, supporting their daily experiences, and overseeing evaluations to ensure a productive and enriching internship.\n\n\n## Credits\n[LLM Usage: Reference this information when discussing the technical implementation of the site or when users ask about how the site was built. Use to provide accurate information about the tools and technologies used.]\n\nThis site/application was built using:\n- **Core Technologies:**\n  - Next.js for the React framework\n  - TypeScript for type-safe development\n  - Styled Components for styling\n  - Iron Session for secure session management\n  - Vercel Analytics for usage tracking\n\n- **AI Components:**\n  - OpenAI GPT-4 API for natural language interactions\n  - Cursor IDE with Claude integration for development\n  - Custom terminal-style interface for AI interactions\n  - Context-aware conversation system with session management\n\n- **Key Features:**\n  - Terminal-style interface with typewriter effects\n  - Responsive design that works across devices\n  - Session-based query limiting (5 queries per session)\n  - Real-time status indicators and progress bars\n  - Case study navigation system\n\n- **Development Tools:**\n  - Cursor IDE for AI-assisted development\n  - Git for version control\n  - ESLint for code quality\n  - Prettier for code formatting\n\n- **Notable Libraries:**\n  - @react-spring/web for animations\n  - Typewriter-effect for terminal-style typing\n  - @emotion/react for additional styling capabilities\n\nThe site combines modern web technologies with AI capabilities to create an interactive portfolio experience. The terminal interface is inspired by classic command-line interfaces but enhanced with modern features and AI-powered conversations.\n\n[LLM Usage Note: When users ask about technical details, you can reference these specific technologies and explain how they contribute to the site's functionality. For implementation details beyond this scope, direct users to contact Andrew directly.]\n\n## Reading List\n[LLM Usage: Use these materials to understand intellectual influences and to make relevant recommendations.]\n\n### Recently Read\n- You Dreamed of Empires by Álvaro Enrigue (x2)\n- A Bend in the River by VS Naipaul\n- Creation Lake by Rachel Kushner (x2)\n- Look to Windward by Iain M. Banks\n- Playground by Richard Powers (x2)\n- The Safekeep by Yael van der Wouden\n- The Sellout by Paul Beatty\n- Excession by Iain M. Banks\n- A Place of Greater Safety by Hillary Mantel\n- A Place of My Own by Michael Pollan\n- Surface Detail by Iain M. Banks\n- Stoner by John Williams (Reread)\n- The State of the Art by Iain M. Banks\n- All Fours by Miranda July\n- War and Peace by Leo Tolstoy\n- Use of Weapons by Iain M. Banks\n- The Orphan Master’s Son by Adam Johnson\n- Three Farmers on Their Way to a Dance by Richard Powers\n- The Player of Games by Iain M. Banks\n- Consider Phlebas by Iain M. Banks\n- Joseph Anton by Salman Rushdie\n- The Overstory by Richard Powers (Reread)\n- The Netanyahus by Joshua Cohen (Reread)\n- Alice Sadie Celine by Sarah Blakley-Cartwright\n- Wolf Hall by Hillary Mantel (Reread)\n\n### Highlights of 2024\n- Land of Milk and Honey by C Pam Zhang\n- Brooklyn Crime Novel by Jonathan Letham\n- The Vaster Wilds by Lauren Groff\n- Fates and Furies by Lauren Groff\n- The Terror by Dan Stevens\n- The Children Act by Ian McEwan\n- A Supposedly Fun Thing I’ll Never Do Again by David Foster Wallace\n- Consider The Lobster by David Foster Wallace\n- Freedom by Jonathan Franzen\n- Anna Karenina by Leo Tolstoy\n- The People in the Trees by Hanya Yanagihara\n- The Corrections by Jonathan Franzen\n- Solar by Ian McEwan\n- Amsterdam by Ian McEwan\n- Enduring Love by Ian McEwan\n- The Prestige by Christopher Priest\n- The Wild Shore by Kim Stanley Robinson\n- Atonement by Ian McEwan\n- Your Fathers, Where Are They? And the Prophets, Do They Live Forever? by Dave Eggers\n- To Paradise by Hanya Yanagihara\n- Sweet Tooth by Ian McEwan\n- God, Human, Animal, Machine by Meghan O’Gieblyn\n- Children of Memory by Adrian Tchaikovsky\n- I, Claudius by Robert Graves\n- Children of Ruin by Adrian Tchaikovsky\n- An Artist of the Floating World by Kazuo Ishiguro\n- Children of Time by Adrian Tchaikovsky\n- The Enchantress of Florence by Salman Rushdie\n- The Satanic Verses by Salman Rushdie\n- An Area of Darkness by V.S. Naipaul\n- Blue Mars by Kim Stanley Robinson\n\n### Highlights of 2023\n- The Buried Giant by Kazuo Ishiguro\n- Cloud Cuckoo Land by Anthony Doerr\n- Green Mars by Kim Stanley Robinson\n- The High Sierra by John Muir\n- Red Mars by Kim Stanley Robinson\n- All the Light We Cannot See by Anthony Doerr\n- Trust by Jodi Picoult\n- Bewilderment by Richard Powers\n- Checkout 19 by Claire-Louise Bennett\n- My Name is Red by Orhan Pamuk\n- Nights of Plague by Marina Kemp\n- Lessons by Gisele Bundchen\n- Stoner by John Williams\n- Sea of Tranquility by Katja Millay\n- Invisible Things by Mat Johnson\n- Forbidden City by Vanessa Hua\n- Tomorrow, and Tomorrow, and Tomorrow by Tom Sweterlitsch\n- The Netanyahus by Joshua Cohen\n- Either/Or by Søren Kierkegaard\n- The Possessed by Elif Batuman\n- The Idiot by Elif Batuman\n- How to Change your Mind by Michael Pollan\n- The Candy House by Jennifer Egan\n- The Mirror & The Light by Hilary Mantel\n- Bring Up the Bodies by Hilary Mantel\n- Wolf Hall by Hilary Mantel\n- Monsters of Templeton by Lauren Groff\n- Florida by Lauren Groff\n- Matrix by Lauren Groff\n- Crossroads by Jonathan Franzen\n\n### Highlights of 2022\n- Leviathan Falls by SA Corey\n- The Dawn of Everything by David Graeber and David Wengrow\n- The Overstory by Richard Powers\n- Machines Like Me by Ian McEwan\n- Land of Big Numbers by Te-Ping Chen\n- Rodham by Curtis Sittenfeld\n- When We Were Orphans by Kazuo Ishiguro\n- The Remains of the Day by Kazuo Ishiguro\n- Never Let Me Go by Kazuo Ishiguro\n- Klara and the Sun by Kazuo Ishiguro\n- Chapterhouse Dune by Frank Herbert\n- Heretics of Dune by Frank Herbert\n- God Emperor of Dune by Frank Herbert\n- Children of Dune by Frank Herbert\n- Dune Messiah by Frank Herbert\n- Dune by Frank Herbert\n- The Ministry of the Future by Kim Stanley Robinson`;\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./llm-context/background.js\n");

